define([],function(ModularList){function ModularList(list){this.list=list;this.count=list.length}ModularList.prototype.currentIndex=0;ModularList.prototype.count=0;ModularList.prototype.current=function(){return this.accessor(this.currentIndex)};ModularList.prototype.next=function(){this.currentIndex=(this.currentIndex+1)%this.count;return this.current()};ModularList.prototype.accessor=function(index){return this.list[index]};return ModularList});